import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import Announcement from "../components/Announcement";
import Newsletter from "../components/Newsletter";
import Footer from "../components/Footer";

const Container = styled.div``;
const Wrapper = styled.div``;
const ImgContainer = styled.div``;
const Image = styled.img`
width: 50%;`;


const Product = () => {
  return (
    <Container>
      <Navbar />
      <Announcement />
      <Wrapper>
          <ImgContainer>
          <Image src="https://i.ibb.co/S6qMxwr/jean.jpg"/>
          </ImgContainer>
          <InfoContainer>
              <Title>
                  <Desc>I normally would write things that make sense on here. But I have
                      decided that it does not make sense to do so. Mind you that we are 
                      going to change this section anyway. So what sense would it make to
                       pour out my brain and choose the poerfect sentences to write in this section?
                  </Desc>
                  <Price>$ 20</Price>
              </Title>
          </InfoContainer>
      </Wrapper>
      <Newsletter />
      <Footer />
    </Container>
  );
};

export default Product;
